import React, { useState } from "react";

function toDoItem(props){
    
    const [isClicked, setIsClicked] = useState

    return (
        <div style={{textDecoration :isClicked ? "line-through": ""}}>
            <li>{props.text}</li>
        </div>
        
    );
}

export default toDoItem;
